import React from 'react';
import './App.css';
import Nav from "./components/Nav/Nav";
import About from "./components/About/About";
import Login from "./components/Login/Login";

function Home() {
  return (
    <div className="App">
       <Nav/>
       <About/>
       <Login/>
    </div>
  );
}

export default Home;
